import React from "react";
import FormUser from "./FormUser";
import "./FormAppend.css";

const FormAppend = (props) => {
  return (
    <ul className="display-user">
      {props.items.map((el) => {
        <FormUser key={el.id} id={el.id}>
          {el.username}({el.age})
        </FormUser>;
      })}
    </ul>
  );
};

export default FormAppend;
